import React from "react";
import { AppBar, Toolbar } from "@mui/material";

function Navbar() {
  return (
    <div>
      <AppBar sx={{ backgroundColor: "white", boxShadow: "none" }}>
        <Toolbar>
          <img
            src="https://cdn2.mymoneymantra.com/white_logo_d23b343666.webp?format=avif&quality=80&width=195&height=45"
            alt="logo"
            style={{
              filter: "invert(39%) sepia(41%) saturate(447%) hue-rotate(120deg)", // Adjust sea green color effect
            }}
          />
        </Toolbar>
      </AppBar>
    </div>
  );
}

export default Navbar;
